if(response_iserror) done();
//Remove response.searchResults root key then remove `account` rootKey from each object in response
done({
  response_body: response_body.response.searchResults.map(r => r.account)
})

if(response_iserror) done();
//Remove response.searchResults root key then remove `candidate` rootKey from each object in response

done({
  response_body: response_body.response.searchResults.map(r => r.candidate)
})

if(response_iserror) done();
//Remove response.searchResults root key then remove `employee` rootKey from each object in response
done({
  response_body: response_body.response.searchResults.map(r => r.employee)
})

let vendorObjectName = request_previous_response.name;
let schema = response_body.definitions[`${vendorObjectName}-def`].properties.response.properties[vendorObjectName].properties;
let body = {};
body.fields = request_previous_response.fields.concat(request_previous_response.customFields.map(field => {
    let newField = {};
    newField.type = newField.vendorNativeType = getFieldType(field.name);
    newField.vendorRequired = field.isRequired === 'true' || field.isRequired === true;
    newField.vendorReadOnly = field.isReadOnly === 'true'|| field.isReadOnly === true;
    newField.filterable = field.isSearchable === 'true' || field.isSearchable === true
    newField.path = newField.vendorPath = field.name;
    newField.custom = field.isCustom == 'true' || field.isCustom == true;

    return newField;
  })
);

done({
  response_body: body
});

function getFieldType(name) {
  return schema[name].type;
}

if(response_iserror) done();

let body = {};
//removing standard fields if customFieldsOnly was passed
if(request_parameters && request_parameters['customFieldsOnly'] === 'true') {
	body.fields = [];
} else {
  body = meta_data;
}
body.customFields = response_body.fields.filter(field => field.isCustom == 'true' || field.isCustom == true);
body.name = response_body.name;
done({response_body: body});

let objectName = request_path_variables['objectName'];

done({
  request_vendor_path: `/object/${getVendorObjectName(objectName)}/description/custom`
})

function getVendorObjectName(name){
  switch(name) {
    case "candidates":
      return 'candidate';
    case "accounts":
      return 'account';
    case "requisitions":
      return 'requisition';
    case "employees":
      return 'employee';
    default:
      return name;
  }
}

if(response_iserror) done();
if(!configuration['username'] ||
   !configuration['taleo.company.code'] || 
   !configuration['password']) {
  done({
    response_body: "Missing configuration(s). Company Code, Username, & Password are required.",
    response_status_code: 400
  });
}
let url = response_body.response.URL;
let username = configuration['username'].endsWith(configuration['taleo.company.code']) ? configuration['username'] : configuration['username'] + "@" + configuration['taleo.company.code'];
let config = {
  'base.url': url.replace(/\/$/g,""),
  'username' : username
};

done({
  configuration: config
});

function checkInvalidCredentials (message) {
  if(message && message.match("Invalid User Name, Password")){
    return 401;
  }
  return 500;
}

if (response_iserror) {
  done({
    response_body: response_body.status.detail,
    response_status_code: checkInvalidCredentials(JSON.stringify(response_body))
  });
} 

done();

// let companyCode = configuration['taleo.company.code'];

// 	done({request_vendor_path: "https://tbe.taleo.net/MANAGER/dispatcher/api/v1/serviceUrl/" + companyCode}); // username is provided as username@companyId so we add companyId to this URL

if(!configuration['username'] ||
   !configuration['taleo.company.code'] || 
   !configuration['password']) {
  done({
    response_body: "Missing configuration(s). Company Code, Username, & Password are required.", 
    continue: false})
}

let requestHeaders = {
  Authorization: `Basic ${CE.b64(configuration['username'] + ':' + configuration['password'])}`
};

done({
  request_vendor_headers: requestHeaders
});

if(response_iserror) done();
//Remove response.searchResults root key then remove `requisition` rootKey from each object in response
done({
  response_body: response_body.response.searchResults.map(r => r.requisition)
})

// Used for all GET all APIs that support paging
if(request_method.toLowerCase() === 'get' && request_parameters && request_parameters['nextPage']){
  // Taleo returns a 'next' URL instead of a cursor so we use it as our request URL if its present
	let url = request_parameters['nextPage'];
  //remove query params since they're already present on the URL we got back from Taleo
  let params = Object.keys(request_parameters).reduce((acc, curr) =>{ 
        acc[curr] = null;
        return acc;
      },{});
  done({
    	request_vendor_parameters: params,
      request_vendor_path:url
    });
}
done();
